import React from "react";
import "./App.css";
import { jsx, ThemeProvider, Styled } from 'theme-ui'
import theme from './theme';

function App() {
  return (
    <ThemeProvider theme={theme}>
      {/* <div
        css={{
          fontFamily: 'body',
          color: 'text',
          bg: 'background',
        }}
      > */}
        <Styled.h1>Theme UI + Create React App</Styled.h1>
      {/* </div> */}
    </ThemeProvider>
  )
}

export default App;
